import ReactDOM from 'react-dom/client';                               //importujemo objekat ReactDOM iz package.json, isto i za ostala dva importa

import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));     //document.getElementById('root') povlaci <div> root iz dokumenta index.html u koji cemo da ubacujemo react; ReactDOM.createRoot() jer metoda iz ReactDOM biblioteke koja kaze React-u da to treba da bude root tj osnova aplikacije gde ce se react aplikacija renderovati
root.render(<App />);
